import React from 'react';

class Login extends React.Component {
    constructor(props) {
        this.state = {
            username: '',
            password: ''
        }
    }

    render() {
        return (
            <div className="container container-fluid">
                <form>
                    <label>
                        User Name:
                        <input type="text" name="name" />
                    </label>
                    <input type="submit" value="Submit" />>
                </form>
            </div>
        )
    }
}

export default Login
